●たっぷり保持ポリマーとスピード吸収ポリマーをダブル配合した「極吸」吸収体を採用。<br>●「横モレブロックギャザー」搭載で多い日の昼間に不安な横モレもしっかりブロック。<br>●どっと出た経血をくりかえしスピード吸収できる「瞬間吸収シート」を表面に採用し、逆戻りが少なく吸収後も表面サラサラ。<br><br><br>CS：36<p>「エリス ウルトラガード 極吸 ふつう-多い日の昼用 羽つき 26枚」は、多い日でも横モレ安心のナプキン 羽つきです。いつもより頼れるスリム。たっぷり保持ポリマーとスピード吸収ポリマーをダブル配合した『極吸』吸収体を採用し、多い日でも安心です。経血の流れをせき止める立体ギャザーで、多い日の昼間に不安な横モレもしっかりブロックします。どっと出た経血を繰り返しスピード吸収できる表面シートを採用。逆戻りが少なく、経血を吸収した後も表面はさらっとしています。ふつう-多い日の昼用。医薬部外品。<br><br>使用上の注意<br>●お肌に合わないときは医師に相談してください。<br>●使用後のナプキンは、個別ラップに包んで捨ててください。<br>●使用後、トイレに流さないでください。<br><br>保管上の注意<br>開封後は、ほこりや虫等が入り込まないよう、衛生的に保管してください。<br><br>材質<br>●構成材料<br>表面材：ポリエチレン<br>色調：白、ブルー(青色404号を含む)<br><br>原産国：日本<br><br>お問い合わせ先<br>エリエールお客様相談室<br>TEL：0120-205205<br>受付時間：土・日・祝日を除く 9：30-16：30<br><br>ブランド：エリス<br>日用品　&gt;　生理用品　&gt;　生理用ナプキン　&gt;　ナプキン ふつうの日用　&gt;　エリス ウルトラガード 極吸 ふつう-多い日の昼用 羽つき 26枚<br>発売元　大王製紙　<br>内容量：26個<br><br>サイズ：20.5cm<br><br>JANコード：　4902011787733</p><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
